select 'INSERT INTO cadastro.imovel_cobranca_situacao (iscb_id, imov_id, iscb_dtimplantacaocobranca, iscb_dtretiradacobranca, iscb_tmultimaalteracao, cbst_id, clie_id, iscb_amreferenciainicio, iscb_amreferenciafinal, cmrv_id, clie_idescritorio, clie_idadvogado, usur_id, iscb_dsobservacao, usur_id_retiradacobranca) VALUES((select NEXTVAL(''cadastro.sequence_imovel_cobranca_situacao'')), '||im.imov_id||', ''2020-12-11'', NULL, now(), 4, '||ci.clie_id ||', 202001, 203001, NULL, NULL, NULL, 2559, ''ARQUIVOS DE RETORNO NÃO ENVIADOS PELO BANCO SANTANDER - EMAIL 11/12/2020'', NULL);'
from arrecadacao.debito_automatico da
left join arrecadacao.agencia ag on (da.agen_id = ag.agen_id)
left join arrecadacao.banco bc on (ag.bnco_id = bc.bnco_id)
left join cadastro.imovel im on (da.imov_id = im.imov_id)
left join faturamento.faturamento_grupo fg on (im.stcm_id = fg.ftgr_id)
left join cadastro.cliente_imovel ci on (im.imov_id = ci.imov_id)
where da.deba_dtexclusao is null and bc.bnco_id = 275 
and ci.clim_dtrelacaofim is null and crtp_id = 1

