from arrecadacao.debito_automatico da
left join arrecadacao.agencia ag on (da.agen_id = ag.agen_id)
left join arrecadacao.banco bc on (ag.bnco_id = bc.bnco_id)
left join cadastro.imovel im on (da.imov_id = im.imov_id)
left join faturamento.faturamento_grupo fg on (im.stcm_id = fg.ftgr_id)
where da.deba_dtexclusao is null and bc.bnco_id = 275);

